import React from "react";

function NavigationBar() {
  return (
    <div>
        <div className="NavBar">
        <ul>
            <p>Home</p>
            <p>Education</p>
            <p>Projects</p>
            <p>Skills</p>
            <p>Contact</p>
        </ul>
        </div>
    </div>
  );
}

export default NavigationBar;
